import { Problem } from "../model";

export const problem: Problem<string, number> = {
    name: 'Minimum Penalty for a Shop',
    id: 2483,
    url: 'https://leetcode.com/problems/minimum-penalty-for-a-shop/',
    solution: bestClosingTime,
    tests: [
        {
            id: 1,
            argument: "YYNY",
            result: 2
        },
        {
            id: 2,
            argument: "NNNNN",
            result: 0
        },
        {
            id: 3,
            argument: "YYYY",
            result: 4
        },
        {
            id: 4,
            argument: "YN",
            result: 1
        },
        {
            id: 5,
            argument: "",
            result: 24971
        }
    ]
}

// linear complexity
function bestClosingTime(customers: string): number {
    const penalties = Array(customers.length+1).fill(0);
    let ncount = 0;
    let ycount = 0;
    for (let index = 0; index < customers.length; index++) {
        const customer = customers[index];
        if (customer === 'N') {
            ncount += 1;
        }
        penalties[index+1] = ncount;
    }
    for (let index = customers.length-1; index >= 0; index--) {
        const customer = customers[index];
        if (customer === 'Y') {
            ycount += 1;
        }
        penalties[index] += ycount;
    }
    //console.log(penalties);
    let mindex = 0;
    let min = penalties[0];
    for (let index = 1; index < penalties.length; index++) {
        if (penalties[index] < min) {
            mindex = index;
            min = penalties[index];
        }
    }
    return mindex;
};